        public ActionResult Login()
        {
            HttpCookie cookie = Request.Cookies["User"];
            if (cookie != null)
            {
                ViewBag.username = cookie["Username"].ToString();
                ViewBag.password = cookie["Password"].ToString();
            }
            return View();
        }
        [HttpPost]
        public ActionResult Autherize(quickPassProject.Models.User _user)
        {
            HttpCookie cookie = new HttpCookie("User");
            if (ModelState.IsValid == true)
            {
                if (_user.RememberMe == true)
                {
                    cookie["Username"] = _user.Username;
                    cookie["Password"] = _user.Password;
                    cookie.Expires = DateTime.Now.AddDays(2);
                    HttpContext.Response.Cookies.Add(cookie);
                }
                else
                {
                    cookie.Expires = DateTime.Now.AddDays(-1);
                    HttpContext.Response.Cookies.Add(cookie);
                }

            }
            using (quickPassEntities db = new quickPassEntities())
            {
                string password = Decrypt.ConvertMD5(_user.Password);
                var userDetails = db.Users.Where(a => a.Username == _user.Username && a.Password == password).FirstOrDefault();
                if (userDetails == null)
                {
                    ViewBag.LoginErrorMessage = "Yanlış kullanıcı adı veya şifre";
                    return View("Login", _user);
                }
                {
                    FormsAuthentication.SetAuthCookie(userDetails.Username, _user.RememberMe);

                    Session["email"] = db.Users.Where(a => a.Username == _user.Username).SingleOrDefault();
                    Session["email"] = userDetails.Email;
                    Session["username"] = userDetails.Username;
                    Session["name"] = userDetails.Name;
                    Session["surname"] = userDetails.Surname;
                    Session["isadmin"] = userDetails.IsAdmin;
                    return RedirectToAction("Index", "Home");
                }
            }
        }
        public ActionResult LogOut()
        {
            Session.Abandon();
